  _rtXdot->Hw1_CSTATE[0] += 188.49555921538757 * Diesel_csi_sf_B.p;

  /* Derivatives for StateSpace: '<S1>/Hw2' */
  _rtXdot->Hw2_CSTATE[0] += -341.08603071128289 * Diesel_csi_sf_X.Hw2_CSTATE[0];
  _rtXdot->Hw2_CSTATE[0] += -178.02459475242631 * Diesel_csi_sf_X.Hw2_CSTATE[1];
  _rtXdot->Hw2_CSTATE[1] += 178.0245947524264 * Diesel_csi_sf_X.Hw2_CSTATE[0];
  _rtXdot->Hw2_CSTATE[2] += 199.58239979893239 * Diesel_csi_sf_X.Hw2_CSTATE[1];
  _rtXdot->Hw2_CSTATE[2] += -247.76277465378331 * Diesel_csi_sf_X.Hw2_CSTATE[2];
  _rtXdot->Hw2_CSTATE[2] += -199.58239979893239 * Diesel_csi_sf_X.Hw2_CSTATE[3];
  _rtXdot->Hw2_CSTATE[3] += 199.58239979893244 * Diesel_csi_sf_X.Hw2_CSTATE[2];
  _rtXdot->Hw2_CSTATE[0] += 188.49555921538757 * Diesel_csi_sf_B.q;

